import React from 'react';
import { Grid } from '@mui/material';

import Details from './components/Details/Details';
import Main from './components/Main/Main';
import { red } from '@mui/material/colors';


function App() {
  return (
    <div>
      <Grid container spacing={5} alignItems='center' justifyContent='center' style={{height: '100vh'}}>

        <Grid item xs={12} sm={4} borderColor={'5px solid rgba(0, 255, 0, 0.5)'}>
          <Details title="Income"/>
        </Grid>

        <Grid item xs={12} sm={4}>
          <Main title="Main"/>
        </Grid>

        <Grid item xs={12} sm={4} border={'5px solid rgba(255, 0, 0, 0.5)'}>
          <Details title="Expense"/>

        </Grid>
      </Grid>
    </div>
  );
}

export default App;
